import React from 'react'

export const AddTransaction = () => {
    return (
        <div className='AddTransaction-box'>
            <h5>Add new transactions</h5>

            <form >
                <div>
                    <label htmlFor="desc">Enter Description</label>
                </div>
            </form>
        </div>
    )
}
